#Créer une base de données discothèque
#	Une discothèque possède les choses suivantes :
#		- Un ou plusieur batiment
#		- Des pièces pour le personnel et pour les clients
#		- Des toilettes, des pistes de dance, des enceintes, des bars ...
#		- Des clients
#		- Des employer
#		- Des DJ
#		- Des chansons
#		- Organise des soirée à thèmes
#		- Possède des heures d'ouverture et de fermeture
#		- Vend des places, de l'alcool, ...
#		- Peut louer des pièces, des batiments
#
#	- Le client veut pouvoir réaliser les actions suivantes : 
#               - Voir le salaire de chacun de ses employers ainsi que leur horaire de travail et les tâches qui leur sont affectés
#               - Voir les soirée à thème programmé (lieu, réduction éventuel, nombre de personne prévu)
#               - Voir l'ensemble des équipements des différentes pièces de la discothèque afin de voir les améliorations pouvant y être apporté
#               - Voir le chiffre d'affaire réalisé à une date données
#               - Voir le chiffre d'affaire pour les soirée à thèmes à une date données
#               - Voir le chiffre d'affaire réalisé entre deux dates
#               - Voir le chiffre d'affaire pour les soirée à thèmes entre deux dates
#               - Voir l'état des finances de la discothèque pour une année fiscale (la différence de tout se qu'il y a à payer et les revenu)
#               - Voir la consommation moyenne de l'ensemble des client
#               - Voir la consommation moyenne de l'ensemble des client avec l'entré
#               - Voir la consommation moyenne pour les 20 plus gros client
#               - Voir la consommation moyenne d'un client
#               - Voir le nombre de client régulier
#               - Afficher le nombre de personne étant venu à une soirée en particulier puis le nombre de personne mineur, entre 18-25, entre 26-35, plus vieux que 36 ans
#
#	- Le client demande un jeu de test sur 3 ans 
#		- Il estime qu'il y a plus de 400 clients
#		- Chaque année on réalise 20 soirée à thème ou plus
#		- Une place coûte entre 10 et 40 euros en fonction du jour de la semaine
#		- Une soirée à thème coûte 15 euro pour les clients
#		- Il y a 3 batiment dans la discothèque possédant entre 5 et 10 pièces
#		- Les consommation coûte entre 5 et 1200 euro


#------------------------------------------------------------
#        Script MySQL.
#------------------------------------------------------------


#------------------------------------------------------------
# Table: building
#------------------------------------------------------------

CREATE TABLE building(
        id           int (11) Auto_increment  NOT NULL ,
        name         Varchar (25) NOT NULL ,
        size         Decimal (25,6) NOT NULL ,
        id_schedule  Int ,
        id_nightclub Int ,
        id_address   Int ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: base_room
#------------------------------------------------------------

CREATE TABLE base_room(
        id        int (11) Auto_increment  NOT NULL ,
        name      Varchar (25) NOT NULL ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: allowed_people
#------------------------------------------------------------

CREATE TABLE allowed_people(
        id   int (11) Auto_increment  NOT NULL ,
        name Varchar (25) NOT NULL ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: gear
#------------------------------------------------------------

CREATE TABLE gear(
        id    int (11) Auto_increment  NOT NULL ,
        name  Varchar (25) NOT NULL ,
        price Decimal (25,2) ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: state
#------------------------------------------------------------

CREATE TABLE state(
        id   int (11) Auto_increment  NOT NULL ,
        name Varchar (25) NOT NULL ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: room
#------------------------------------------------------------

CREATE TABLE room(
        id             int (11) Auto_increment  NOT NULL ,
        name           Varchar (25) NOT NULL ,
        entrance_price Decimal (25,2) ,
        nb_people      Int NOT NULL ,
        set_at         Date NOT NULL ,
        id_building    Int ,
        id_base_room   Int ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: employee
#------------------------------------------------------------

CREATE TABLE employee(
        id         int (11) Auto_increment  NOT NULL ,
        firstname  Varchar (25) NOT NULL ,
        lastname   Varchar (25) NOT NULL ,
        number     Varchar (8) NOT NULL ,
        start_at   Date NOT NULL ,
        end_at     Date DEFAULT NULL ,
        salary     Int NOT NULL ,
        id_post    Int ,
        id_address Int ,
        PRIMARY KEY (id ) ,
        UNIQUE (number )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: schedule
#------------------------------------------------------------

CREATE TABLE schedule(
        id       int (11) Auto_increment  NOT NULL ,
        start_at Time NOT NULL ,
        end_at   Time DEFAULT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: post
#------------------------------------------------------------

CREATE TABLE post(
        id          int (11) Auto_increment  NOT NULL ,
        name        Varchar (25) NOT NULL ,
        base_salary Int NOT NULL ,
        id_schedule Int ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: nightclub
#------------------------------------------------------------

CREATE TABLE nightclub(
        id   int (11) Auto_increment  NOT NULL ,
        name Varchar (25) NOT NULL ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: dj
#------------------------------------------------------------

CREATE TABLE dj(
        id Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: song
#------------------------------------------------------------

CREATE TABLE song(
        id        int (11) Auto_increment  NOT NULL ,
        name      Varchar (50) NOT NULL ,
        duration  Time NOT NULL ,
        id_author Int ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: author
#------------------------------------------------------------

CREATE TABLE author(
        id   int (11) Auto_increment  NOT NULL ,
        name Varchar (40) ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: song_type
#------------------------------------------------------------

CREATE TABLE song_type(
        id   int (11) Auto_increment  NOT NULL ,
        name Varchar (25) NOT NULL ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: customer
#------------------------------------------------------------

CREATE TABLE customer(
        id            int (11) Auto_increment  NOT NULL ,
        firstname     Varchar (25) NOT NULL ,
        lastname      Varchar (25) ,
        date_of_birth Date NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: address
#------------------------------------------------------------

CREATE TABLE address(
        id          int (11) Auto_increment  NOT NULL ,
        postal_code Varchar (20) NOT NULL ,
        civic_num   Varchar (8) NOT NULL ,
        street_name Varchar (50) NOT NULL ,
        town_name   Varchar (50) NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: theme_room
#------------------------------------------------------------

CREATE TABLE theme_room(
        id   int (11) Auto_increment  NOT NULL ,
        name Varchar (25) NOT NULL ,
        PRIMARY KEY (id ) ,
        UNIQUE (name )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: base_room_allowed_people
#------------------------------------------------------------

CREATE TABLE base_room_allowed_people(
        id_base_room      Int NOT NULL ,
        id_allowed_people Int NOT NULL ,
        PRIMARY KEY (id_base_room ,id_allowed_people )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: room_gear
#------------------------------------------------------------

CREATE TABLE room_gear(
        set_at    Date NOT NULL ,
        remove_at Date ,
        quantity  Int NOT NULL ,
        id_gear   Int NOT NULL ,
        id_room   Int NOT NULL ,
        PRIMARY KEY (id_gear ,id_room )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: room_state
#------------------------------------------------------------

CREATE TABLE room_state(
        observed_at Date NOT NULL ,
        id_state    Int NOT NULL ,
        id_room     Int NOT NULL ,
        PRIMARY KEY (id_state ,id_room )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: gear_state
#------------------------------------------------------------

CREATE TABLE gear_state(
        observed_at Date NOT NULL ,
        id_state    Int NOT NULL ,
        id_gear     Int NOT NULL ,
        PRIMARY KEY (id_state ,id_gear )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: employee_room
#------------------------------------------------------------

CREATE TABLE employee_room(
        id_employee  Int NOT NULL ,
        id_room      Int NOT NULL ,
        PRIMARY KEY (id_employee ,id_room )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: employee_dj
#------------------------------------------------------------

CREATE TABLE employee_dj(
        id_employee  Int NOT NULL ,
        id_dj        Int NOT NULL ,
        PRIMARY KEY (id_employee ,id_dj )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: dj_room
#------------------------------------------------------------

CREATE TABLE dj_room(
        id       int (11) Auto_increment  NOT NULL ,
        work_at  Date NOT NULL ,
        start_at Time ,
        end_at   Time ,
        id_dj    Int NOT NULL ,
        id_room  Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: nightclub_song
#------------------------------------------------------------

CREATE TABLE nightclub_song(
        price         Decimal (25,2) NOT NULL ,
        getting_at    Date NOT NULL ,
        stoping_at    Date NOT NULL ,
        id_nightclub  Int NOT NULL ,
        id_song       Int NOT NULL ,
        PRIMARY KEY (id_nightclub ,id_song )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: song_song_type
#------------------------------------------------------------

CREATE TABLE song_song_type(
        id_song      Int NOT NULL ,
        id_song_type Int NOT NULL ,
        PRIMARY KEY (id_song ,id_song_type )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: room_salable_gear
#------------------------------------------------------------

CREATE TABLE room_salable_gear(
        price    Decimal (25,2) NOT NULL ,
        quantity Int NOT NULL ,
        buy_at   Date NOT NULL ,
        id_room  Int NOT NULL ,
        id_gear  Int NOT NULL ,
        PRIMARY KEY (id_room ,id_gear )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: customer_room
#------------------------------------------------------------

CREATE TABLE customer_room(
        id          int (11) Auto_increment  NOT NULL ,
        buy_at      Date NOT NULL ,
        id_customer Int NOT NULL ,
        id_room     Int NOT NULL ,
        id_gear     Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: leasing_room
#------------------------------------------------------------

CREATE TABLE leasing_room(
        id          int (11) Auto_increment  NOT NULL ,
        start_at    Date NOT NULL ,
        end_at      Date NOT NULL ,
        price       Decimal (25,2) NOT NULL ,
        id_room     Int NOT NULL ,
        id_customer Int NOT NULL ,
        PRIMARY KEY (id)
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: leasing_building
#------------------------------------------------------------

CREATE TABLE leasing_building(
        id          int (11) Auto_increment  NOT NULL ,
        start_at    Date NOT NULL ,
        end_at      Date NOT NULL ,
        price       Decimal (25,2) NOT NULL ,
        id_customer Int NOT NULL ,
        id_building Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: theme_room_gear
#------------------------------------------------------------

CREATE TABLE theme_room_gear(
        quantity      Int NOT NULL ,
        id_theme_room Int NOT NULL ,
        id_gear       Int NOT NULL ,
        PRIMARY KEY (id_theme_room ,id_gear )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: room_theme_room
#------------------------------------------------------------

CREATE TABLE room_theme_room(
        id            int (11) Auto_increment  NOT NULL ,
        start_at      Date NOT NULL ,
        end_at        Date NOT NULL ,
        id_room       Int NOT NULL ,
        id_theme_room Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: played
#------------------------------------------------------------

CREATE TABLE played(
        id        int (11) Auto_increment  NOT NULL ,
        played_on Date NOT NULL ,
        id_song   Int NOT NULL ,
        id_room   Int NOT NULL ,
        PRIMARY KEY (id )
)ENGINE=InnoDB;


#------------------------------------------------------------
# Table: dj_played
#------------------------------------------------------------

CREATE TABLE dj_played(
        played_on Date NOT NULL ,
        id_song   Int NOT NULL ,
        id_room   Int NOT NULL ,
        id_dj     Int NOT NULL ,
        PRIMARY KEY (id_song ,id_room ,id_dj )
)ENGINE=InnoDB;

