#Select queries

#       - Voir le salaire de chacun de ses employers ainsi que leur horaire de travail et les tâches qui leur sont affectés
INSERT INTO employee_room VALUES (1,1);
SELECT CONCAT(employee.lastname, ' ', employee.firstname) AS Employee, 
employee.salary AS Salary, 
CONCAT(schedule.start_at, ' => ', schedule.end_at) AS Work,
post.name AS Post
,room.name AS Workplace
FROM room  
INNER JOIN employee_room ON employee_room.id_room = room.id
INNER JOIN employee ON employee.id = employee_room.id_employee
INNER JOIN post ON employee.id_post = post.id
INNER JOIN schedule ON post.id_schedule = schedule.id
GROUP BY employee.id;



##-----------------
SELECT CONCAT(employee.lastname, ' ', employee.firstname) AS Employee, 
employee.salary AS Salary, 
CONCAT(schedule.start_at, ' => ', schedule.end_at) AS Work,
post.name AS Post
FROM employee 
INNER JOIN post ON employee.id_post = post.id
INNER JOIN schedule ON post.id_schedule = schedule.id
GROUP BY employee.id;
##-----------------

#       - Voir les soirée à thème programmé (lieu, réduction éventuel, nombre de personne prévu)
SELECT theme_room.name AS Party, 
SUM(room.nb_people) AS Capacity, 
room_theme_room.start_at AS Date,
CONCAT(address.postal_code,' ',address.civic_num,' ',address.street_name,' ',address.town_name) AS address,
SUM(room.entrance_price) AS Price
FROM theme_room INNER JOIN room_theme_room ON theme_room.id = room_theme_room.id_theme_room
INNER JOIN room ON room_theme_room.id_room = room.id
INNER JOIN building ON room.id_building = building.id
INNER JOIN address ON building.id_address = address.id
#WHERE room_theme_room.start_at > NOW()
GROUP BY building.id, Date #room_theme_room.id
ORDER BY Date ASC;

#       - Voir l'ensemble des équipements des différentes pièces de la discothèque afin de voir les améliorations pouvant y être apporté
SELECT building.name AS building, 
room.name AS Room, 
room.nb_people AS Capacity, 
room_gear.quantity AS Quantity, 
gear.name AS Equipment,
state.name AS State
FROM building
INNER JOIN room ON building.id = room.id_building
INNER JOIN room_gear ON room.id = room_gear.id_room
INNER JOIN gear ON room_gear.id_gear = gear.id
INNER JOIN gear_state ON gear.id = gear_state.id_gear
INNER JOIN state ON gear_state.id_state = state.id
GROUP BY building.id, room.id, gear.id, state.id
ORDER BY state.name = 'NOK' DESC;

#       - Voir le chiffre d'affaire réalisé à une date données
#       - Voir le chiffre d'affaire pour les soirée à thèmes à une date données
#       - Voir le chiffre d'affaire réalisé entre deux dates
SET @dateYear='2015';
SET @dateStart=CONCAT(@dateYear,'-01-01');
SET @dateEnd=CONCAT(@dateYear,'-12-31');

SELECT Q1.Returned_Gear, Q4.Returned_Building, Q5.Returned_Room, (
(IF(Q1.Returned_Gear != NULL,0,Q1.Returned_Gear) + IF(Q4.Returned_Building != NULL,0,Q4.Returned_Building) + IF(Q5.Returned_Room != NULL,0,Q5.Returned_Room))) AS Result 
FROM
(
        SELECT SUM(gear.price + room.entrance_price) AS Returned_Gear
        FROM customer 
        INNER JOIN customer_room ON customer.id = customer_room.id_customer 
        INNER JOIN gear ON customer_room.id_gear = gear.id 
        INNER JOIN room ON customer_room.id_room = room.id 
        WHERE customer_room.buy_at >= @dateStart AND customer_room.buy_at <= @dateEnd
) AS Q1,
(
        SELECT SUM(leasing_building.price) AS Returned_Building
        FROM leasing_building
        WHERE leasing_building.start_at >= @dateStart AND leasing_building.end_at <= @dateEnd
) AS Q4, 
(
        SELECT SUM(leasing_room.price) AS Returned_Room
        FROM leasing_room
        WHERE leasing_room.start_at >= @dateStart AND leasing_room.end_at <= @dateEnd
) AS Q5;

#       - Voir le chiffre d'affaire pour les soirée à thèmes entre deux dates
SET @dateYear='2015';
SET @dateStart=CONCAT(@dateYear,'-01-12');
SET @dateEnd=CONCAT(@dateYear,'-12-31');

SELECT theme_room.name AS Party_Name, CONCAT(address.postal_code, ' ', address.civic_num, ' ', address.street_name, ' ', address.town_name) AS Party_Address, room_theme_room.start_at AS Party_day
FROM theme_room 
INNER JOIN room_theme_room ON theme_room.id = room_theme_room.id_room
INNER JOIN room ON room_theme_room.id_room = room.id
INNER JOIN building ON room.id_building = building.id
INNER JOIN address ON building.id_address = address.id
WHERE room_theme_room.start_at BETWEEN @dateStart AND @dateEnd;

#       - Voir l'état des finances de la discothèque pour une année fiscale (la différence de tout se qu'il y a à payer et les revenu)
SET @dateYear='2015';
SET @dateStart=CONCAT(@dateYear,'-01-01');
SET @dateEnd=CONCAT(@dateYear,'-12-31');

SELECT Q1.Returned_Gear, Q2.Spent_Gear, Q3.Spent_Salary, Q4.Returned_Building, Q5.Returned_Room, (
(IF(Q1.Returned_Gear != 'NULL',0,Q1.Returned_Gear) + IF(Q4.Returned_Building != 'NULL',0,Q4.Returned_Building) + IF(Q5.Returned_Room != 'NULL',0,Q5.Returned_Room)) - (IF(Q2.Spent_Gear != 'NULL',0,Q2.Spent_Gear) + IF(Q3.Spent_Salary != 'NULL',0,Q3.Spent_Salary))) AS Result 
FROM
(
        SELECT SUM(gear.price + room.entrance_price) AS Returned_Gear
        FROM customer 
        INNER JOIN customer_room ON customer.id = customer_room.id_customer 
        INNER JOIN gear ON customer_room.id_gear = gear.id 
        INNER JOIN room ON customer_room.id_room = room.id 
        WHERE customer_room.buy_at >= @dateStart AND customer_room.buy_at <= @dateEnd
) AS Q1, 
(
        SELECT SUM(room_salable_gear.quantity * gear.price) AS Spent_Gear
        FROM room 
        INNER JOIN room_salable_gear ON room.id = room_salable_gear.id_room 
        INNER JOIN gear ON room_salable_gear.id_gear = gear.id
        WHERE room_salable_gear.buy_at >= @dateStart AND room_salable_gear.buy_at <= @dateEnd
) AS Q2, 
(
        SELECT SUM(salary *  (MONTH(IF(@dateEnd > employee.end_at,@dateEnd,employee.end_at)) - MONTH(IF(@dateStart < employee.start_at,employee.start_at,@dateStart)) + 1)) AS Spent_Salary
        FROM employee
) AS Q3, 
(
        SELECT SUM(leasing_building.price) AS Returned_Building
        FROM leasing_building
        WHERE (
                (leasing_building.start_at BETWEEN @dateStart AND @dateEnd) AND
                (
                        (
                                (leasing_building.end_at BETWEEN @dateStart AND @dateEnd) AND 
                                (leasing_building.end_at >= leasing_building.start_at)
                        ) OR 
                        leasing_building.end_at = '0000-00-00'
                )
              )
) AS Q4, 
(
        SELECT SUM(leasing_room.price) AS Returned_Room
        FROM leasing_room
        WHERE (
                (leasing_room.start_at BETWEEN @dateStart AND @dateEnd) AND
                (
                        (
                                (leasing_room.end_at BETWEEN @dateStart AND @dateEnd) AND 
                                (leasing_room.end_at >= leasing_room.start_at)
                        ) OR 
                        leasing_room.end_at = '0000-00-00'
                )
              )
) AS Q5;

#       - Voir la consommation moyenne de l'ensemble des client
SELECT AVG(gear.price) AS 'Consuption Average' 
FROM customer 
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
INNER JOIN gear ON customer_room.id_gear = gear.id
WHERE customer_room.buy_at BETWEEN '2015-04-04' AND '2015-04-04'; 

#       - Voir la consommation moyenne de l'ensemble des client avec l'entré
SELECT AVG(gear.price + room.entrance_price) AS 'Consuption Average With Entries' 
FROM customer 
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
INNER JOIN gear ON customer_room.id_gear = gear.id 
INNER JOIN room ON customer_room.id_room = room.id;
WHERE customer_room.buy_at BETWEEN '2015-04-04' AND '2015-04-04'
GROUP BY customer.id; 


#       - Voir la consommation moyenne d'un client
SET @clientId='10';
SELECT CONCAT(customer.firstname, ' ', customer.lastname) AS Customer, AVG(gear.price) AS 'Consuption Average' FROM customer INNER JOIN customer_room ON customer.id = customer_room.id_customer INNER JOIN gear ON customer_room.id_gear = gear.id WHERE customer.id = @clientId GROUP BY customer.id; 

#       - Voir la consommation moyenne pour les 20 plus gros client
SELECT CONCAT(customer.firstname, ' ', customer.lastname) AS Customer, AVG(gear.price) AS Consuption_Average FROM customer INNER JOIN customer_room ON customer.id = customer_room.id_customer INNER JOIN gear ON customer_room.id_gear = gear.id GROUP BY customer.id ORDER BY Consuption_Average DESC LIMIT 20; 

#       - Voir la consommation moyenne d'un client avec entré
SET @clientId='10';
SELECT CONCAT(customer.firstname, ' ', customer.lastname) AS Customer, AVG(gear.price + room.entrance_price) AS 'Consuption Average' FROM customer INNER JOIN customer_room ON customer.id = customer_room.id_customer INNER JOIN gear ON customer_room.id_gear = gear.id INNER JOIN room ON customer_room.id_room = room.id WHERE customer.id = @clientId GROUP BY customer.id; 

#       - Voir la consommation moyenne pour les 20 plus gros client avec entré
SELECT CONCAT(customer.firstname, ' ', customer.lastname) AS Customer, AVG(gear.price + room.entrance_price) AS Consuption_Average FROM customer INNER JOIN customer_room ON customer.id = customer_room.id_customer INNER JOIN gear ON customer_room.id_gear = gear.id INNER JOIN room ON customer_room.id_room = room.id GROUP BY customer.id ORDER BY Consuption_Average DESC LIMIT 20; 

#       - Voir le nombre de client régulier
SET @regularity='10';
SELECT CONCAT(customer.firstname, ' ', customer.lastname) AS Customer, 
COUNT(customer_room.id_customer) AS Entries 
FROM customer 
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
GROUP BY customer.id 
HAVING Entries >= @regularity 
ORDER BY Entries DESC;

#       - La consommation d'un client avec l'entrée
SELECT SUM(gear.price + room.entrance_price) AS 'Consuption SUM With Entries' 
FROM customer 
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
INNER JOIN gear ON customer_room.id_gear = gear.id 
INNER JOIN room ON customer_room.id_room = room.id
WHERE customer.id = 1; 

SELECT SUM(gear.price) AS 'Consuption SUM' 
FROM customer 
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
INNER JOIN gear ON customer_room.id_gear = gear.id 
WHERE customer.id = 1; 

SELECT SUM(room.entrance_price) AS 'Entries SUM' 
FROM customer 
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
INNER JOIN room ON customer_room.id_room = room.id
WHERE customer.id = 1; 

SELECT CONCAT(customer.firstname, ' ', customer.lastname) AS Customer, CONCAT(gear.name,' for ',gear.price) AS Gear
FROM customer 
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
INNER JOIN gear ON customer_room.id_gear = gear.id 
INNER JOIN room ON customer_room.id_room = room.id
