#       - Afficher la consommation des personnes de plus de 25 ans qui consomme moins que la moyenne des consommations sur une période de temp dans une année
SET @dateYear='2015';
SET @dateStart=CONCAT(@dateYear,'-04-04');
SET @dateEnd=CONCAT(@dateYear,'-04-04');

SELECT CONCAT(customer.firstname, ' ', customer.lastname) AS Customer
, Average.Consuption_Average
, SUM(gear.price + room.entrance_price) AS Consuption
FROM 
(
        SELECT AVG(gear.price + room.entrance_price) AS Consuption_Average
        FROM customer 
        INNER JOIN customer_room ON customer.id = customer_room.id_customer 
        INNER JOIN gear ON customer_room.id_gear = gear.id 
        INNER JOIN room ON customer_room.id_room = room.id
        WHERE (customer_room.buy_at BETWEEN @dateStart AND @dateEnd) 
        AND ((YEAR(@dateEnd) - YEAR(customer.date_of_birth)) >= 25)
) AS Average,
customer
INNER JOIN customer_room ON customer.id = customer_room.id_customer 
INNER JOIN gear ON customer_room.id_gear = gear.id 
INNER JOIN room ON customer_room.id_room = room.id
WHERE (customer_room.buy_at BETWEEN @dateStart AND @dateEnd) 
AND ((YEAR(@dateEnd) - YEAR(customer.date_of_birth)) >= 25)
GROUP BY customer.id
HAVING Consuption <= Average.Consuption_Average





LIMIT 1

UNION

